import React from 'react';
import Socialbtn from './socialbtn';

const socialiconlist = (props) => props.containedbtn.map((arrayheading) =>{
        return  <Socialbtn
                class={arrayheading.class}
                disable={arrayheading.disable}
                />
     });

export default socialiconlist;
